import React, { useState, useEffect } from 'react';

function FetchRSIAnalysis({ stockCode, selectedAnalysis }) {
    const [analysisResult, setAnalysisResult] = useState({});  // 분석 결과 저장할 상태

    useEffect(() => {
        const query = selectedAnalysis.join(',');
        fetch(`http://127.0.0.1:8000/apis/analyze_rsi/${stockCode}/?analysis=${query}`)
            .then(res => res.json())
            .then(data => {setAnalysisResult(data);
            })
            .catch(error => console.error('Error fetching RSI analysis:', error));
    }, [stockCode, selectedAnalysis])

    return (
        <div>
            {selectedAnalysis.includes('1') && analysisResult.rsi_analysis1 && (
                <p dangerouslySetInnerHTML={{__html: analysisResult.rsi_analysis1.analysisResult}}></p>
            )}
            {selectedAnalysis.includes('2') && analysisResult.rsi_analysis2 && (
                <p dangerouslySetInnerHTML={{__html: analysisResult.rsi_analysis2.analysisResult}}></p>
            )}
            {selectedAnalysis.includes('3') && analysisResult.rsi_analysis3 && (
                <p dangerouslySetInnerHTML={{__html: analysisResult.rsi_analysis3.analysisResult}}></p>
            )}
            {selectedAnalysis.includes('4') && analysisResult.rsi_analysis4 && (
                <p dangerouslySetInnerHTML={{__html: analysisResult.rsi_analysis4.analysisResult}}></p>
            )}
            {selectedAnalysis.includes('5') && analysisResult.rsi_analysis5 && (
                <p dangerouslySetInnerHTML={{__html: analysisResult.rsi_analysis5.analysisResult}}></p>
            )}
        </div>
    );
}

export default FetchRSIAnalysis;
